create table products (
	product_id VARCHAR(2),
	product_barcode VARCHAR(12),
	product_name VARCHAR(10),
	product_description VARCHAR(1),
	product_inv_stock VARCHAR(2),
	product_inv_in_transit VARCHAR(1),
	product_inv_total VARCHAR(2),
	product_min_qty VARCHAR(1),
	product_purchase_qty VARCHAR(1),
	product_location_id VARCHAR(1),
	product_category_id VARCHAR(1),
	product_supplier_id VARCHAR(1)
);
